import React, { Component } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";

import TodoMain from "./components/TodoMain";

export class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <TodoMain />
        </div>
      </Router>
    );
  }
}

export default App;
